    <div className="App">
        <h1>Aprenda React com a Labenu!</h1>
      <span>
        <img src={logoLabenu} alt="logo" />
      </span>
      <span>
      </span>

      <a>Site da Labenu!</a>
      <button onClick={falarBoaNoite}>Clique aqui</button>
    </div>
  );
}

export default App;
